import React from 'react'

export default class CharacterCreater extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      initiative: null,
      dexterity: null,
      name: null,
      portrait: null,
    }
  }

  render(){
    return(
      <form>
        <label>Name:
        <input type="text" name="name"/></label>
        <label>Initiative:
        <input type="text" name="Initiative"/></label>
        <label>Dexterity:
        <input type="text" name="Dexterity"/></label>
        <label>Portrait: 
        <input type="text" name="Portrait"/></label>
      </form>
    )
  }
}
